import './CreateTodoButton.css'
function CreateTodoButton(props) {

    const onClickButton = () => {
      props.openModal ? props.setOpenModal(false) : props.setOpenModal(true) 
    }
  
    return (
      <button className="CreateTodoButton"
        onClick={onClickButton} 
      >
        +
      </button>
    );
  }
